import React from 'react'
import s from './window.module.css'
import Header from './Header/Header';
import Content from './Content/Content';
import Icon from '../../Images/Calculator.png'

const Window = (props) => {

    return (
        <div className={s.Window}>
            <Header WindowName={'Имя окна'} MainButtons={[1, 1, 1]} WindowIcon={Icon} className={s.Header}/>
            <Content Text={props.Text} className={s.Content}/>
        </div>
    );
}


export default Window;
